package main

import (
	"fmt"

	UploadFile "server/infrastructure/action"
	"server/infrastructure/logger"
)

func main() {
	// Search()
	action := UploadFile.NewFileClient()

	base64Image := "data:image/png;base64,"
	fileName := "test.png"
	url, err := action.Upload(&base64Image, fileName)
	if err != nil {
		logger.Error(err.Error())
		return
	}

	fmt.Println(*url)
}
